import { Component, OnInit } from '@angular/core';
import { faStar } from '@fortawesome/free-solid-svg-icons';
@Component({
  selector: 'app-hero-page-l',
  templateUrl: './hero-page-l.component.html',
  styleUrls: ['./hero-page-l.component.scss']
})
export class HeroPageLComponent implements OnInit {
  star = faStar;
  places:any[] = [];

  ngOnInit(): void {
    this.places = [
      {place:'Kioto', price:480, stars:4, img:'../../assets/places/kioto.jpg'},
      {place:'Egypt', price:280, stars:4, img:'../../assets/places/egypt.jpg'},
      {place:'Kioto', price:200, stars:4, img:'../../assets/places/losAngeles.jpg'},
      {place:'Kioto', price:380, stars:4, img:'../../assets/places/Sydney.jpg'},
    ]
  }

}
